@tiiare.cofrre No, señora. Justamente por eso este país está como está. porque asumimos que todos haríamos lo mismo si tuviéramos poder. Pero no, no todos normalizamos la evasión ni nos parece ‘natural’ esconder platas en paraísos fiscales. Eso no es inteligencia, es corrupción con corbata.

Y hablando de Kast, sí, él aparece en los Panama Papers vinculado a sociedades offshore. ¿Y qué hace mientras tanto? Opina sobre impuestos como si fuera un mártir tributario. Es como si un pirómano diera charlas de prevención de incendios. El doble estándar es brutal.

No se trata de envidia, se trata de ética. Algunos creemos que la política debe servir al bien común, no a blindar fortunas. Y si no le incomoda que un político esconda plata afuera mientras habla de patriotismo y orden económico, el problema no lo tengo yo.

@nic0_oyarzun Sí, estamos hablando de dirigir un país. Justamente por eso es importante que quienes lo lideren den el ejemplo, no que escondan plata en paraísos fiscales mientras piden ‘sacrificio’ a los demás. ¿O cree que la ética personal y la coherencia no importan en la política?
Porque si un político evade impuestos o elige bancos en Panamá para no pagar lo que corresponde, no es un detalle menor: es un reflejo de cómo gobierna, a quién protege y de qué lado está.
No es ‘el banco preferente de una persona’, es una señal de su visión de país: uno donde el poderoso se salta las reglas y el ciudadano común las paga todas. Y sí, me quedan neuronas… por eso no le creo a alguien que predica orden mientras practica evasión.

@ls.gnv Me importa porque cuando alguien saca plata a paraísos fiscales no lo hace por diversión, lo hace para pagar menos impuestos o evadir fiscalización. Y no, no ‘paga igual’. Esa es la gracia de los Panama Papers: destaparon cómo miles de millonarios usan empresas offshore para esconder patrimonio, evitar tributos y mover plata sin control.
¿Y por qué me importa? Porque cuando los que más tienen no pagan lo que les corresponde, ¿quién creís que cubre el hoyo fiscal? Nosotros po, los de abajo. Así que sí me incumbe, porque después nos suben el IVA, nos recortan salud y educación, mientras los ‘patriotas’ como Kast esconden su plata en Panamá.
Esto no es envidia, es justicia fiscal. Si alguien quiere dirigir un país, que parta cumpliendo las reglas acá, no arrancando con la plata pa’ afuera. ¿O también te parecería normal que un bombero esconda agua en el desierto mientras se incendia el pueblo?
